def solution():
    import math

    def find_smallest_multiplier(n):
        prime_factors = {}
        # Prime factorization
        for i in range(2, int(math.sqrt(n)) + 1):
            while n % i == 0:
                n //= i
                prime_factors[i] = prime_factors.get(i, 0) + 1
        if n > 1:
            prime_factors[n] = prime_factors.get(n, 0) + 1

        # Find the smallest multiplier such that all the prime factors have an even power
        multiplier = 1
        for factor, power in prime_factors.items():
            if power % 2 != 0:
                multiplier *= factor

        return multiplier

    ans = find_smallest_multiplier(28)
    return ans

