    def can_win(n):
        # Base case: If n is 0, then we cannot make a move, hence we lose
        if n == 0:
            return False
        # If we can force the opponent into a losing position by removing 1, 3, 4, or 6,
        # then we are in a winning position
        if not can_win(n - 1) or not can_win(n - 3) or not can_win(n - 4) or not can_win(n - 6):
            return True
        # If the opponent can always move to a winning position, we are in a losing position
        return False

    # Starting from 1 to 52, find the first losing position
    for i in range(1, 53):
        if not can_win(i):
            losing_position = i
            break

    # If the first losing position is reachable by doing valid moves (1, 3, 4, 6)
    # from the start (0), Betty should let Abby start so Abby ends up in the losing position.
    # Otherwise, Betty should start and avoid moving to losing positions.
    if losing_position in (1, 3, 4, 6):
        return "Second", losing_position
    else:
        return "First", losing_position

