def solution():
    # The problem described is an example of a derangement problem
    # also known as a permutation where no element appears in its original position (subfactorial).
    n = 6  # Number of students (and thus number of exercise books)

    # Using formula for derangement: !n = (n-1)(!(n-1) + !(n-2)), with base cases !0 = 1 and !1 = 0
    # Recursive function to calculate the subfactorial of n
    def subfactorial(k):
        if k == 0:
            return 1
        if k == 1:
            return 0
        return (k - 1) * (subfactorial(k - 1) + subfactorial(k - 2))

    # Number of ways each person can get an exercise book not their own is the subfactorial of n
    return subfactorial(n)

ans = solution()

