    def is_multiple_of_9(num):
        return sum(int(digit) for digit in str(num)) % 9 == 0

    # Function to generate numbers
    def generate_numbers(current_number, available_digits):
        if len(current_number) == 5:
            number = int(''.join(map(str, current_number)))
            if number >= 10000 and is_multiple_of_9(number):
                multiples_of_9.append(number)
        else:
