def solution():
    # The smallest 5-digit number is 10000
    # The smallest palindrome greater than or equal to 10000
    # that is a multiple of 45 can be found by iterating from 10000 onwards

    # Since the number must be divisible by 45 and hence by 9, the sum of the digits must be divisible by 9
    # Since it's palindromic, the first and last two digits must be the same, i.e., xyzyx
    # Thus x + y + z + y + x = 2x + 2y + z must be divisible by 9
    # The smallest x for a five-digit number is 1

    # Find the smallest palindromic multiple of 45
    smallest_palindrome = None
    for x in range(1, 10):
        for y in range(0, 10):
            for z in range(0, 10):
                if (2*x + 2*y + z) % 9 == 0:
                    palindrome = int(str(x) + str(y) + str(z) + str(y) + str(x))
                    if palindrome >= 10000 and palindrome % 45 == 0:
                        smallest_palindrome = palindrome
                        break
            if smallest_palindrome:
                break
        if smallest_palindrome:
            break

    # The largest palindrome smaller than 100000
    # that is a multiple of 45 can be found by iterating downwards from 99999

    # Since the number must be divisible by 45 and hence by 9, the sum of the digits must be divisible by 9
    # Since it's palindromic, the first and last two digits must be the same, i.e., xyzyx
    # The largest x for a five-digit number is 9

    # Find the largest palindromic multiple of 45
    largest_palindrome = None
    for x in range(9, 0, -1):
        for y in range(9, -1, -1):
            for z in range(9, -1, -1):
                if (2*x + 2*y + z) % 9 == 0:
                    palindrome = int(str(x) + str(y) + str(z) + str(y) + str(x))
                    if palindrome < 100000 and palindrome % 45 == 0:
                        largest_palindrome = palindrome
                        break
            if largest_palindrome:
                break
        if largest_palindrome:
            break

    # Calculate the difference between the largest and smallest palindromic numbers
    difference = largest_palindrome - smallest_palindrome

    return difference

ans = solution()

