    # The function will count the ways to partition the number 8 into the sum of two or more non-zero natural numbers.
    def partitions(n, I=1):
        yield (n,)
        for i in range(I, n // 2 + 1):
            for p in partitions(n - i, i):
                yield (i,) + p

    # To find all unique partitions of the number 8
    unique_partitions = set(partitions(8))

