from itertools import permutations

def solution():
    def number_of_factors(n):
        return sum(n % i == 0 for i in range(1, n + 1))

    def is_compatible(permutation, may_knows_her_number):
        # Checking if two students know their number of factors
        known_factors_count = sum(number_of_factors(num) in [2, 3, 4, 5] for num in permutation)
        # The May's condition checks: greater than Mark by 1 and smaller than Alice by 2
        # (which must be an odd number)
        return (known_factors_count == 2 and may_knows_her_number)

    # Create all permutations of 9 numbers from the 13
    all_combinations = list(permutations(range(1, 14), 9))

    # Assuming May is the second student, May's number should be odd and there's a number smaller by 1
    # and there should be a number greater than May's by 2 (which Alice observes)
    for combination in all_combinations:
        for i, may_number in enumerate(combination):
            # We know that May's number is smaller than an odd number (Alice's) by 2
            # and is bigger than (Mark's) by 1. So there is Mark's and Alice's numbers.
            if may_number % 2 == 1 and (may_number + 2) in combination and (may_number - 1) in combination:
                # Check if this permutation is compatible with the conditions
                if is_compatible(combination, True):
                    remaining_numbers = set(range(1, 14)) - set(combination)
                    return eval('*'.join(str(num) for num in remaining_numbers))

