def solution():
    count = 0
    # Loop through all 3-digit numbers
    for i in range(100, 1000):
        str_i = str(i)
        # Check if third digit is the sum of the first two
        if int(str_i[2]) == int(str_i[0]) + int(str_i[1]):
            count += 1
    return count

ans = solution()

